import React from 'react';

const ViewResumes = () => {
  return (
    <div className="p-4">
      <h2>View Resumes</h2>
      {/* Simulate a list of resumes */}
      <div>Resume 1</div>
      <div>Resume 2</div>
      <div>Resume 3</div>
    </div>
  );
};

export default ViewResumes;
